import './ProjectList.css';
import { useLocation } from 'react-router-dom';
import Header from '../../Components/Header/Header';

function ProjectList() {
  const { search } = useLocation();
  const queryParams = new URLSearchParams(search);
  const selectedOption1 = queryParams.get('domain');
  const selectedOption2 = queryParams.get('topic');

  const dynamicOptions1 = [
    { value: 'computerscience', label: 'Computer Science' , a:'ss' },
    { value: 'mechanical', label: 'Mechanical' },
    { value: 'civil', label: 'Civil' },
  ];

  return (
    <>
      <Header/>
      <div className='spacer'></div>
      <div className='heading'>
        <h2>Here are your search results</h2>
        <div className='fields'>
          <div className='field-display'>
            <p>{selectedOption1}</p>
          </div>
          <div className='field-display'>
            <p>{selectedOption2}</p>
          </div>
        </div>
      </div>

      {dynamicOptions1.map((option) => (
        <div className='project-box'>
        <div className='LHS'>
          <h3>Hello Title</h3>
          <p>Hello Title</p>
          <div className='av-docs'>
            <div className='doc'><p>Report</p></div>
            <div className='doc'><p>Source Code</p></div>
          </div>
        </div>
        <div className='RHS'>
          <div className='topic'>
            <p>TOPIC</p>
          </div>
          <div className='rating'>
            <p>4.5/5</p>
          </div>
        </div>
      </div>
      ))}

    </>
  );
}

export default ProjectList;
